def isPalindrome(s):
    for i in range(0, len(s)):
        if s[i] != s[len(s)-i-1]:
            return 0
    return 1


def validPalindrome(s):
    """
    :type s: str
    :rtype: bool
    """
    if isPalindrome(s):
        return True
    else:
        for i in range(0, len(s)):
            if s[i] != s[len(s)-i-1]:
                if isPalindrome(s[0:i] + s[i+1:] ) ==1 or isPalindrome(s[0: len(s)-i-1] +  s[len(s)-i:]) == 1:
                    return True
                else:
                    return False



print(validPalindrome("abca"))
print(validPalindrome(""))
print(validPalindrome(""))
print(validPalindrome(""))
print(validPalindrome("12345627890987654321"))
print(validPalindrome(""))
print(validPalindrome("abc"))











